export default {
	GoToCadastro: async () => {
		let username = Input1.text
		let password = Input2.text

		await DoLogin.Login(username, password).then((obj) => {
			if(obj.hasOwnProperty('access')) {
					storeValue('access_token', obj.access)
					storeValue('refresh_token', obj.access)
					navigateTo("Tabela")
			} else {
					showAlert("login ou senha incorretos")
			}
		}).catch(() => showAlert("Login ou senha incorretos"))
	}
}
